import React from "react";
import { useState } from "react";
import Switch from "@mui/material/Switch"
import FormGroup from "@mui/material/FormGroup"
import { FormControl, FormLabel, FormControlLabel, Typography, makeStyles, createStyles, Theme, createTheme, ThemeProvider } from "@mui/material";

const Activator = () => {
    const [checked, setChecked] = useState(false)

    const handleChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        setChecked(event.target.checked)
    }
   
    const useStyles: any = makeStyles((theme: Theme) => ({
        typo: {
            textAlign: "left    "
        }
    }));

    const classes = useStyles()

    return (
        <>   
            <Typography variant="h2" sx={{marginLeft: 5}} className={classes.typo}>Service Activator</Typography>
            <FormControl sx={{marginLeft: 10}}>
                <FormLabel focused={false}>Press to activate the service:</FormLabel>
                <FormGroup>
                    <FormControlLabel control={<Switch checked={checked} onChange={handleChange} name="activator" color="secondary"/>} 
                        label="Activate"/>
                </FormGroup>
            </FormControl>
        </>
    )
}

export default Activator;
